script: |
  super -f text -I q5965.spq | sort > q5965.out

inputs:
  - name: q5965.spq
    data: |
      SELECT col1 FROM tab1 (FORMAT parquet) WHERE + col0 NOT BETWEEN col1 * - 59 + col1 * CAST ( NULL AS INTEGER ) * - - col1 * 7 * col0 AND col1;
  - name: tab1

outputs:
  - name: q5965.out
    data: |
      14
      47
      5
